const initialState = {
  S: [

   {
    name: "Arjiu",
    salar: "1200"
  }
  ]
}

export default  (state = initialState, action) => {
    switch (action.type) {
      case 'REGISTER':
        state.push(action.payload)
        return state;
      default:
        return state;
    }
  };
